import BlankTextImage from "./BlankTextImage";
import UlFlex from "./UlFlex";
import UlFlexImgText from "./UlFlexImgText";
import image from "../image";
let logoUlimg1 = [
    image.logoUl1,
    image.logoUl2,
    image.logoUl3,
    image.logoUl4
]
let logoUlimg2 = [
    image.logoUl11,
    image.logoUl12,
    image.logoUl13,
    image.logoUl14,
    image.logoUl15
]
function Home() {

    return (
        <div>
            <BlankTextImage
                img={image.rocketBlankTextImage}
                topText={'Next genaretion platform'}
                h1Text={'Artificial intelligence & Syber security'}
                mainText={'Lorem ipsum is placeholder text ' +
                    'commonly used in the graphic, print, and ' +
                    'publishing industries for previewing layouts' +
                    ' and visual mockups.'}
                button={2}
                button1={'Get Started'}
                imgButton2={image.playIcon}
                button2={'Watch Video'}
            />
            <UlFlex
                img={logoUlimg1}
                backgroundColor={'#0d1a2c'}
                count={4}

            />
            <BlankTextImage
                reverse={true}
                img={image.rocketBlankTextImage}
                topText={'Next genaretion platform'}
                h1Text={'Artificial intelligence & Syber security'}
                mainText={'Lorem ipsum is placeholder text ' +
                    'commonly used in the graphic, print, and ' +
                    'publishing industries for previewing layouts' +
                    ' and visual mockups.'}
                button={2}
                button1={'Get Started'}
                imgButton2={image.playIcon}
                button2={'Watch Video'}
            />
        </div>
    )
}
export default Home
